    data: |
      SELECT - 0 - CASE cor0.col0 WHEN cor0.col0 * cor0.col0 THEN + cor0.col0 ELSE - cor0.col0 END FROM tab0 AS cor0 GROUP BY cor0.col2, cor0.col0;
  - name: tab0

outputs:
  - name: q191.out
    data: |
      26
      43
      83
